import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六辛日己丑时断</p><p>六辛日生时己丑，金土持争势不安；</p><p>年月财官相救助，免交贫困受饥寒。</p><p>辛日己丑时，金土相争。</p><p>辛以己为倒食，丑上有明己暗辛。</p><p>岁月无财官救助者，贫困；得财官运，亦吉。</p><p>辛丑日己丑时，孤浊滞生。</p><p>申酉月，金旺，运行火乡，疏通，刑伤妻子；为僧道，贵。</p><p>纯丑，西南运，大贵。</p><p>辛卯日己丑时，寅卯亥未等月，财星格，南方运，贵。</p><p>辰戌丑未，印绶，南方运，吉。</p><p>辛已日己丑时，丑已申酉月生，金多克木，损伤妻子；僧道，贵。</p><p>寅卯辰。</p><p>月，南运，贵。</p><p>辛未日己丑时，寅卯未月，财星格。</p><p>已午，官显。</p><p>辛酉日己丑时，破祖。</p><p>已酉丑月，金多克木，俊俏有财，难为妻子。</p><p>寅午月，近侍，贵。</p><p>辛亥日己丑时，寅已午月，官星明朗，立计成象。</p><p>卯未，财局，富贵。</p><p>未戌，冲，吉。</p><p>申、子、辰月月，金水氵亟秀，佳。</p><p>酉建禄、行木火运、吉。</p><p>纯亥，金水氵亟秀，贵。</p><p>己丑时逢辛日险，财官埋没未为奇；六亲骨肉多刑害，年月冲开富贵推。</p><p>辛日时临己丑，总由倒食淹留。</p><p>就中金柜紧监收，午未戌开成就。</p><p>甲丙卯寅发福，癸壬亥子漂流。</p><p>少年谋望事难周，中未前程自有。</p>",30),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","252卷 九·六辛日己丑时断.html.vue"]]);export{f as default};
